  true,\n\t\"url\": null,\n\t\"notes\": \"<div>The geographic area covered by this
  dataset includes the entire stormwater drainage system withinu00a0Raleigh's Extraterritorial
  Jurisdiction (ETJ).u00a0Theu00a0<b>Drainage Basinsu00a0</b>dataset includes polygons
  representing the boundaries for specific drainage basins as defined by Public Works.
  This dataset also includes labels and attributes which identify each basin and describe
  its physical characteristics.u00a0The Public Works Department's Stormwater Management
  Division conducted a detailed inventory of stormwater drainage systems within the
  Raleigh area. This dataset was created as a part of that inventory. Mapping this
  drainage system is a requirement of the federal Clean Water Act governing the discharge
  of stormwater into the Neuse River.</div><div><br /></div><div>Part of a map service
  displaying the City of Raleigh's stormwater inventory.u00a0</div>\",\n\t\"license_title\":
